import React from 'react';
import { settings } from 'config/C4';

const OverViewContributions = () => {
    const { accessToken } = settings;
    async function getContributions(token, username) {
        const headers = {
            'Authorization': `bearer ${token}`,
        }
        const body = {
            "query": `query {
                user(login: "${username}") {
                  name
                  contributionsCollection {
                    contributionCalendar {
                      colors
                      totalContributions
                      weeks {
                        contributionDays {
                          color
                          contributionCount
                          date
                          weekday
                        }
                        firstDay
                      }
                    }
                  }
                }
              }`
        }
        const response = await fetch('https://api.github.com/graphql', { method: 'POST', body: JSON.stringify(body), headers: headers })
        const data = await response.json()
        return data
    }
    
    const data = getContributions(accessToken, 'JannekeCoumans');
    console.log(data)

    return (
        <h1>OverViewContributions</h1>
    )
}

export default OverViewContributions;
